// Logo.js
import React, { useRef } from 'react';
import { useFrame } from '@react-three/fiber';
import { Text } from '@react-three/drei';

const Logo = () => {
  const logoRef = useRef();

  // Animación para mover hacia arriba
  useFrame(() => {
    if (logoRef.current.position.y < 5) {
      logoRef.current.position.y += 0.02;
    }
  });

  return (
    <group ref={logoRef}>
      <text
        position={[0, 0, 0]}
        fontSize={1}
        color="white"
        anchorX="center"
        anchorY="middle"
        letterSpacing={-0.05}
      >
        DivingES
      </text>
    </group>
  );
};

export default Logo;
